public static boolean isPowerOf3(int n) {
    if (n == 0) {
        return false;
    } else if (n % 3 == 0) {
        return true;
    } 
    int x = n;
    while (x > 0) {
        if (x % 3 == 0) {
            return true;
        }
        x -= 3;
    }
    return false;
}
```

The key steps are:

1. Check if n is 0. If so, return false.

2. Otherwise, check if n is divisible by 3. If so, return true.

3. If not, repeatedly decrease n by 3 until it hits 0. If the remainder of any division is 0, then n is a power of 3.

4. Return true if we found a divisor, false otherwise.

So this solves the problem by directly checking for the existence of an x such that 3^x = n. No loops or recursive calls are needed.

